import { API } from "@/util/config"
import { BaseService } from "@/Service/Setting/BaseService"

export const FetchBooks = () => {
  return fetch(`${API}/books`)
    .then((response) => response.json())
    .catch((error) => {
      console.error("Error fetching books:", error)
    })
}
